DROP TABLE IF EXISTS `filmitem`;

CREATE TABLE `filmitem` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `filmtitle` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `release_date` date DEFAULT NULL,
  `boxoffice` int(11) DEFAULT NULL,
  `filmtype` enum('c','tv','tvs','mini') COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'c - cinema film, v - tv-film, tvs - series, mini - mini-series',
  `cover_photo_id` int(10) unsigned NOT NULL COMMENT 'Identifying photo in the page',
  `summary` text COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=501 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Film general information';



#
# TABLE STRUCTURE FOR: countries
#

DROP TABLE IF EXISTS `countries`;

CREATE TABLE `countries` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `country` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='The list of countries';


DROP TABLE IF EXISTS `photos`;

CREATE TABLE `photos` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `obj_type` enum('p','f') COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'p - person''s photo, f - film images',
  `original_id` bigint(20) unsigned NOT NULL,
  `caption` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Photos and images';





#
# TABLE STRUCTURE FOR: genres
#

DROP TABLE IF EXISTS `genres`;

CREATE TABLE `genres` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `genre` varchar(30) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Genre list';



#
# TABLE STRUCTURE FOR: keywords
#

DROP TABLE IF EXISTS `keywords`;

CREATE TABLE `keywords` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `keyword` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='All possible keywords';



#
# TABLE STRUCTURE FOR: languages
#

DROP TABLE IF EXISTS `languages`;

CREATE TABLE `languages` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
