  CONSTRAINT `people_ibfk_2` FOREIGN KEY (`cover_photo_id`) REFERENCES `photos` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5001 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='People involved with the production';



